class ToggleLike{constructor(t){this.toggler=t,this.toggleLike()}toggleLike(){$(this.toggler).click((function(t){t.preventDefault();let e=this;$.ajax({type:"POST",url:$(e).attr("href")}).done((function(t){let l=parseInt($(e).attr("data-likes"));1==t.data.delete_var?l-=1:l+=1,$(e).attr("data-likes",l),$(e).html(` <i id='like'class="fas fa-thumbs-up"></i> ${l} `)})).fail((function(t){console.log("error in completing the request")}))}))}}